'Black Mamba' ( Tribute to Kobe Bryant)
Smoothly gliding on the court and striking without any mercy,
His every move in the arena flowed like a beautiful symphony; 
Each basket scored, each dunk causing tremors of excitement among spectators,
His way of controlling the court brought praise even from the haters;
A legend indeed in a game demanding excellence beyond athleticism;
He redfined the movement, balling and dribbling mechanism;
His scoring made even the greatest opponents  shower him with praise,
He just reached a zenith of basketball leaving everyone amazed,
We celebrate your brilliance today, as in insync we sing,
'Strike Black Mamba!' The Ultimate Basketball King!
